import antdEn from "antd/lib/locale-provider/en_US";
import enMessages from "../locales/en_US.json";

// enMessages["sidebar.recipes"] = "Recipes";

const EnLang = (menuItemSibar) => {
  if (menuItemSibar) enMessages[menuItemSibar?.label] = menuItemSibar?.key;

  const EnLang_data = {
    messages: {
      ...enMessages,
    },
    antd: antdEn,
    locale: "en-US",
  };

  return EnLang_data;
};

export default EnLang;
